import React from 'react';

export default function Product () {
    async function getProducts() {
        let result = await fetch('https://my-json-server.typicode.com/tdmichaelis/json-api/products');
        let object = await result.json();
        console.log(object);
    }

    getProducts().then(r => null);
    return (
        <div className={'Product'}>
            <div className={'Image'}><img>This is the image.</img></div>
            <div className={'Body'}>
                <div className={'Title'}>This is the title</div>
                <div className={'Description'}>This is the description.</div>
                <div className={'Ratings'}>
                    <div className={'Price'}>$100.50</div>
                    <div className={'Ratings'}>5.5</div>
                    <button>Add to Cart</button>
                </div>
            </div>
        </div>
    )
}
